<html lang="zh-CN">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>双周期SAR策略回测 - 真实数据交互图表</title>
    <script src="https://cdn.jsdelivr.net/npm/echarts@5.4.3/dist/echarts.min.js"></script>
    <style>
        body {
            margin: 0;
            padding: 20px;
            font-family: 'Microsoft YaHei', Arial, sans-serif;
            background: linear-gradient(135deg, #1a1a2e 0%, #16213e 50%, #0f3460 100%);
            color: #ffffff;
            min-height: 100vh;
        }
        .container {
            max-width: 1800px;
            margin: 0 auto;
        }
        .header {
            text-align: center;
            margin-bottom: 30px;
            background: rgba(255, 255, 255, 0.08);
            padding: 25px;
            border-radius: 15px;
            backdrop-filter: blur(15px);
            border: 1px solid rgba(255, 255, 255, 0.1);
        }
        .header h1 {
            margin: 0 0 15px 0;
            color: #00d4ff;
            text-shadow: 0 0 30px rgba(0, 212, 255, 0.4);
            font-size: 2.2em;
        }
        .config-info {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 15px;
            margin-top: 20px;
            padding: 20px;
            background: rgba(0, 0, 0, 0.2);
            border-radius: 10px;
        }
        .config-item {
            display: flex;
            justify-content: space-between;
            padding: 8px 12px;
            background: rgba(255, 255, 255, 0.05);
            border-radius: 6px;
            border-left: 3px solid #00d4ff;
        }
        .chart-container {
            width: 100%;
            height: 800px;
            background: rgba(255, 255, 255, 0.08);
            border-radius: 15px;
            padding: 20px;
            box-shadow: 0 10px 40px rgba(0, 0, 0, 0.4);
            backdrop-filter: blur(15px);
            border: 1px solid rgba(255, 255, 255, 0.1);
        }
        .legend {
            display: flex;
            justify-content: center;
            gap: 30px;
            margin-bottom: 25px;
            flex-wrap: wrap;
        }
        .legend-item {
            display: flex;
            align-items: center;
            gap: 10px;
            font-size: 15px;
            background: rgba(255, 255, 255, 0.08);
            padding: 10px 15px;
            border-radius: 8px;
            border: 1px solid rgba(255, 255, 255, 0.1);
        }
        .legend-color {
            width: 16px;
            height: 16px;
            border-radius: 4px;
            box-shadow: 0 0 10px rgba(255, 255, 255, 0.3);
        }
        .info-panel {
            background: rgba(255, 255, 255, 0.08);
            padding: 25px;
            border-radius: 15px;
            margin-top: 30px;
            backdrop-filter: blur(15px);
            border: 1px solid rgba(255, 255, 255, 0.1);
        }
        .info-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));
            gap: 15px;
        }
        .info-row {
            display: flex;
            justify-content: space-between;
            padding: 12px 15px;
            background: rgba(0, 0, 0, 0.3);
            border-radius: 8px;
            border-left: 4px solid #00d4ff;
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="header">
            <h1>🎯 单周期SAR策略回测 - 1hK线图表</h1>
            <p style="color: #cccccc; font-size: 16px;">💫 1hSAR动态止损 + 固定止盈 | 🎯 真实回测数据 | 📊 交互式分析</p>
            
            <div class="config-info">
                <div class="config-item">
                    <span>📅 回测开始:</span>

                </div>
                <div class="config-item">

                    <span style="color: #00d4ff; font-weight: bold;">2025-09-27 23:59:59</span>
                </div>

                    <span>🎯 时间周期:</span>
                    <span style="color: #00d4ff; font-weight: bold;">1h</span>
                </div>
                <div class="config-item">
                    <span>⚡ SAR参数:</span>
                    <span style="color: #00d4ff; font-weight: bold;">0.02/0.02/0.14</span>
                </div>
                <div class="config-item">
                    <span>💰 初始资金:</span>
                    <span style="color: #00d4ff; font-weight: bold;">$100,000</span>
                </div>
                <div class="config-item">
                    <span>📊 K线数量:</span>
                    <span style="color: #00d4ff; font-weight: bold;">6480</span>
                </div>
                <div class="config-item">
                    <span>🎯 交易信号:</span>
                    <span style="color: #00d4ff; font-weight: bold;">2021</span>
                </div>
            </div>
        </div>

        <div class="legend">
            <div class="legend-item">
                <div class="legend-color" style="background: linear-gradient(45deg, #00da3c, #00ff41);"></div>
                <span>📈 上涨K线</span>
            </div>
            <div class="legend-item">
                <div class="legend-color" style="background: linear-gradient(45deg, #ec0000, #ff1744);"></div>
                <span>📉 下跌K线</span>
            </div>
            <div class="legend-item">
                <div class="legend-color" style="background: linear-gradient(45deg, #ffaa00, #ffc107);"></div>
                <span>🎯 1h SAR (动态止损)</span>
            </div>
        </div>

        <div class="chart-container">
            <div id="main-chart" style="width: 100%; height: 100%;"></div>
        </div>

        <div class="info-panel">
            <h3>📊 当前K线详情</h3>
            <div class="info-grid" id="currentInfo">
                <div class="info-row">
                    <span>🕐 时间:</span>
                    <span id="currentTime">点击K线查看详情</span>
                </div>
                <div class="info-row">
                    <span>📈 开盘:</span>
                    <span id="currentOpen">-</span>
                </div>
                <div class="info-row">
                    <span>⬆️ 最高:</span>
                    <span id="currentHigh">-</span>
                </div>
                <div class="info-row">
                    <span>⬇️ 最低:</span>
                    <span id="currentLow">-</span>
                </div>
                <div class="info-row">
                    <span>📉 收盘:</span>
                    <span id="currentClose">-</span>
                </div>
                <div class="info-row">
                    <span>🎯 1h SAR:</span>
                    <span id="currentSAR">-</span>
                </div>
            </div>
        </div>
    </div>

            myChart.resize();
        });
        
        console.log('🚀 真实回测数据图表已加载');
